    "story_diva_desc_02"                             : "\u6226\u8853\u97F3\u697D\u30E6\u30CB\u30C3\u30C8\u300C\u30EF\u30EB\u30AD\u30E5\u30FC\u30EC\u300D\u306E\u30A8\u30FC\u30B9\u30DC\u30FC\u30AB\u30EB\u3002\n\n\u7D20\u6027\u3084\u7D4C\u6B74\u306E\u4E00\u5207\u304C\u8B0E\u306B\u5305\u307E\u308C\u3066\u3044\u308B\n\u30DF\u30B9\u30C6\u30EA\u30A2\u30B9\u306A\u5B58\u5728\u3002\n\n\u6B4C\u306B\u5BFE\u3057\u3066\u5F37\u3044\u3053\u3060\u308F\u308A\u3092\u898B\u305B\u3001\n\u3069\u306E\u3088\u3046\u306A\u5371\u6A5F\u306B\u8972\u308F\u308C\u3066\u3082\u6C7A\u3057\u3066\u6B4C\u3046\u3053\u3068\u3092\u8AE6\u3081\u306A\u3044\u3002",
    "story_diva_desc_03"                             : "\u6226\u8853\u97F3\u697D\u30E6\u30CB\u30C3\u30C8\u300C\u30EF\u30EB\u30AD\u30E5\u30FC\u30EC\u300D\u306E\u30EA\u30FC\u30C0\u30FC\u3002\n\n\u30B9\u30B1\u30B8\u30E5\u30FC\u30EB\u7BA1\u7406\u3092\u306F\u3058\u3081\u3001\n\u30C1\u30FC\u30E0\u306E\u30DE\u30CD\u30B8\u30E1\u30F3\u30C8\u3082\u3053\u306A\u3059\u3057\u3063\u304B\u308A\u8005\u3002\n\n\u30EF\u30EB\u30AD\u30E5\u30FC\u30EC\u306B\u52A0\u5165\u3059\u308B\u524D\u306F\u3001\n\u30BD\u30ED\u3067\u30A2\u30A4\u30C9\u30EB\u6D3B\u52D5\u3092\u884C\u3063\u3066\u3044\u305F\u3002",
    "story_diva_desc_04"                             : "\u6226\u8853\u97F3\u697D\u30E6\u30CB\u30C3\u30C8\u300C\u30EF\u30EB\u30AD\u30E5\u30FC\u30EC\u300D\u306E\u30E1\u30F3\u30D0\u30FC\u3002\n\n\u4EE3\u3005\u30E1\u30AB\u30CB\u30C3\u30AF\u3068\u3044\u3046\u5BB6\u7CFB\u306E\u751F\u307E\u308C\u3067\u3001\n\u81EA\u8EAB\u3082\u307E\u305F\u4E00\u6D41\u306E\u8155\u3092\u6301\u3064\u30E1\u30AB\u30CB\u30C3\u30AF\u3067\u3042\u308B\u3002\n\n\u4EF2\u9593\u3084\u30E1\u30AB\u306B\u3042\u3060\u540D\u3092\u3064\u3051\u308B\u7656\u304C\u3042\u308B\u3002\n\u30EC\u30A4\u30CA\u3068\u306F\u59C9\u59B9\u306E\u3088\u3046\u306B\u4EF2\u304C\u826F\u3044\u3002",
